module mux_aoi_2_1 ( 
	input logic  [0 : 0] I0, 
	input logic  [0 : 0] I1, 
input logic S, 
	output logic [0 : 0] O); 

logic  [1 : 0] out_sel;

precoder_1_2 u_precoder ( 
	.S(S), 
	.out_sel(out_sel)); 

mux_logic_1_2 u_mux_logic ( 
	.I0 (I0),
	.I1 (I1),
	.out_sel(out_sel), 
	.O(O)); 

endmodule 

module precoder_1_2 ( 
	input logic  [0 : 0] S ,
	output logic  [1 : 0] out_sel );

always_comb begin: mux_sel 
	case (S) 
		1'd0    :   out_sel = 2'b01; 
		1'd1    :   out_sel = 2'b10; 
		default :   out_sel = 2'b0; 
	endcase 
end 

endmodule 

module mux_logic_1_2 ( 
	input logic  [1 : 0] out_sel,
	input logic  [0 : 0] I0, 
	input logic  [0 : 0] I1, 
	output logic [0 : 0] O); 

always_comb begin: out_sel_logic 
	case (out_sel) 
		2'b01    :   O = I0;
		2'b10    :   O = I1;
		default :   O = 0; 
	endcase 
end 
endmodule

